import React, { useState } from 'react';

const Rastreio = () => {
    const [rastreio, setRastreio] = useState("");

    const handleRastrear = () => {
        if (rastreio.length >= 8) {
            const docPrefix = rastreio.slice(0, 3); // Pega os primeiros 3 números como prefixo
            const docNumber = rastreio.slice(3); // O restante será o número do documento

            // Sempre definindo "Doméstico"
            const rastreioUrl = `https://www.latamcargo.com/pt/trackshipment?docNumber=${docNumber}&docPrefix=${docPrefix}&soType=SO`;
            window.open(rastreioUrl, '_blank');
        } else {
            alert("Número de rastreio inválido!");
        }
    };

    return (
        <div>
            <h2>Rastreamento</h2>
            <input 
                type="text" 
                placeholder="Número do Rastreamento" 
                value={rastreio} 
                onChange={(e) => setRastreio(e.target.value)} 
            />
            <button onClick={handleRastrear}>Rastrear</button>
        </div>
    );
};

export default Rastreio;
